class Time {
    constructor(e, n) {
        this.minutes = e,
            this.sec = n
    }
}

/* Takes seconds and convers it to a time object with minutes/seconds attributes */
const runTime = (seconds) => {
    let minutes;
    return (minutes = Math.floor(seconds / 60)), new Time(minutes, seconds - 60 * minutes);
}

/* Returns the seconds converted to the format xx:xx ex:(10:30) */
const runTimeString = (seconds) => {
    let timeString;
    let time;
    time = runTime(seconds);
    timeString = time.minutes + ":" + (time.sec < 10 ? '0' + time.sec:time.sec);
    return timeString;
}

/*Takes a time input in format xx:xx and turns it to seconds equivalent*/
function hms(timeString) { 
    let r = 0;
    let s = 1;
    for (let n = timeString.split(":"); n.length > 0; /* No ++ needed because pop() reduces the length of n to 0 */) { 
        if (n[0] == "") {
            n[0] = 0;
        }
        r += s * parseInt(n.pop(), 10), s *= 60; 
    }
    return r 
}

function changeLapTime() {
    let lapTime = runTime(Math.floor(runSlider.value / 6));
    let text = "Req'd 6 Lap Time: ~" + lapTime.minutes + ":" + (lapTime.sec.toFixed(0) < 10 ? '0'+lapTime.sec.toFixed(0) : lapTime.sec.toFixed(0));
    for (let i = 0; i < 6; i++) {
        let u = runTime(Math.floor(runSlider.value / 6) * (i + 1));
        text += "<br>Lap " + (i + 1) + ":  " + u.minutes + ":" + (u.sec.toFixed(0) < 10 ? '0'+u.sec.toFixed(0) : u.sec.toFixed(0));
    };
    lapTimeP.innerHTML = text;
};
changeLapTime();

function changeTxtboxes(txt1, txt2, slider) {
    if (arguments.length == 3) {
        let runtime = runTime(slider.value);
        txt1.value = (runtime.minutes < 10 ? '0' + runtime.minutes : runtime.minutes).toString();
        txt2.value = (runtime.sec < 10 ? '0' + runtime.sec : runtime.sec).toString();
    } else {
        let slider = txt2;
        txt1.value = slider.value;
    }
}
changeTxtboxes(mintxt, sectxt, runSlider);
changeTxtboxes(pushtxt, pushSlider);

function calculateRunScore(e, n) { let r; for (let s = 0; s < n.length; s++) { r = n[s]; let a = r.range.split(" - ")[0], o = r.range.split(" - ")[1]; if (e >= hms(a) && e <= hms(o)) return r.points } return 0 } 
    
function calculateShuttleScore(e, n) { let r; for (let s = 0; s < n.cardio.length; s++) { if (r = n.cardio[s], 0 == s) { if (e >= r.range.slice(1)) return r.points } let a = r.range.split(" - ")[0], o = r.range.split(" - ")[1]; if (e >= a && e <= o) return r.points } return 0 } 
    
function calculateStrengthScore(e, n) { let r = e.toString(); return isNaN(n.strength[r]) ? 0 : n.strength[r] } 
    
function calculateSitupsScore(e, n) { let r = e.toString(); return isNaN(n.abs[r]) ? 0 : n.abs[r] } 
    
function didWalkPass(e, n) { return e <= hms(n.cardio.max) }

function updateScoreMinMaxText() {
    runscore = calculateRunScore(runSlider.value, scoreArrays.cardio);
    runtxt_p.innerHTML = "Run Score: " + runscore + " | Min: " + runTimeString(runmin) + " | Max: " + runTimeString(runmax);
    sitscore = calculateSitupsScore(sitSlider.value, scoreArrays);
    sittxt_p.innerHTML = "Abs Score: " + sitscore + " | Min: " + sitmin + " | Max: " + sitmax;
    pushscore = calculateStrengthScore(pushSlider.value, scoreArrays);
    pushtxt_p.innerHTML = "Strength Score: " + pushscore + " | Min: " + pushmin + " | Max: " + pushmax;
}
updateScoreMinMaxText();

function runSlideInput() {
  changeLapTime();
  updateScoreMinMaxText();
  changeTxtboxes(mintxt, sectxt, runSlider);
}
runSlider.addEventListener('input', runSlideInput);
runSlider.removeEventListener('input', runSlideInput);

pushSel.addEventListener('change', () => {
  pushSlider.min = 20;
  pushSlider.max = 50;
  changeTxtboxes(pushtxt, pushSlider);
});